import React from 'react';
import { connect, useSelector } from "react-redux";
import AwaitLoading from '../../UserInterface/AwaitLoading/AwaitLoading';

import RowTable from './RowTable'

function TableList (props){
    
    const stateLoading = useSelector(state => state.stateFlagsEltypeClass.loading);
    const styles = { loading: "Loading" };
    
        if (stateLoading) {
        return <AwaitLoading
            classname={styles.loading}
                />
    } 
    
    return(
        <React.Fragment>
            <div className={props.classname}>
                <table className={props.classname}>
                    <thead className={props.classname}>
                        <tr className={props.classname}>
                        {
                            props.columnName.map((name, index) =>  <th key={index}> {name} </th>)
                        }
                        </tr>
                      </thead>

                    <tbody>
                        {
                        props.dataTable.map((data, index) =>
                                            <RowTable
                                                dataRow={data}
                                                key={index}
                                                onclick={props.onclick}
                                            />)
                        }
                    </tbody>  
                </table>
        </div>
    </React.Fragment>
    )
}

export default TableList
